        private void onSelectionChanged(object sender, System.EventArgs e)
        {
            textBoxICDChinh.BackColor = Color.White;

            if (m_combo.SelectedIndex >= 0)
            {
                textBoxICDChinh.Text = m_combo.SelectedValue.ToString();
                //txtLoiDan.Text = ((DataTable)comboBoxChanDoanChinh.DataSource).Rows[comboBoxChanDoanChinh.SelectedIndex]["LoiDan"].ToString();

                //if (pUti.parseBool(((DataTable)comboBoxChanDoanChinh.DataSource).Rows[comboBoxChanDoanChinh.SelectedIndex]["LaManTinh"]))
                //    textBoxICDChinh.BackColor = Color.PeachPuff;
            }
            else
            {
                textBoxICDChinh.Text = "";
                //txtLoiDan.Text = "";
            }
            m_label.Text = string.Format("Selection: '{0}',{1}", m_combo.SelectedItem,m_combo.SelectedIndex);
        }

        private void onMethodChanged(object sender, System.EventArgs e)
        {
            MethodItem mi = (MethodItem) m_methodCB.SelectedItem;
            m_combo.MatchingMethod = mi.Value;
        }

        private void textBoxICDChinh_TextChanged(object sender, System.EventArgs e)
        {
            DataTable dt = (DataTable)m_combo.DataSource;
            if (dt != null && textBoxICDChinh.Text != "")
                for (int i = 0; i < dt.Rows.Count; i++)
                {
                    if (dt.Rows[i]["ICDcode"].ToString() == textBoxICDChinh.Text)
                        m_combo.SelectedIndex = i;
                }
        }

